            <p> can help make your text more clear, simple and useful for the reader. Homer provides information on an overall text as well as on individual paragraphs and it gives insights into readability, length of paragraphs, length of sentences, average sentences per paragraph, average words in a sentence, etc. Homer also tries to identify certain kind of vague words as well as tracking the frequency of "and" words in the text. </p>
